import React from "react";
import "../app.css"

export default function Navbar(){
    return(
        <nav className="navbar">
            <h1 className="navHeading">Survey Form</h1>
            <p>User1</p>
            <img className="navImg" src="/Images/IITR logo.png" alt="IIT Roorkee's Logo"/>
        </nav>
    )
}
